import React from 'react';
import Button from './Button';
import NavStory from './NavStory';
import TextBox from './TextBox';
import ViewStories from './ViewStories';


function App() {
  return (
    <div>
      <h2 id='count'>Count with me!</h2>
      <Button initialVal={45}/>
      <NavStory /> 
      <ViewStories />
      <TextBox />
   </div>
  );
}

export default App;
